.checkbox-wrap {
  margin-bottom: @12px;

  &:last-child {
    margin: 0;
  }

  input[type=checkbox] {
    display: none;
  }

  label {
    cursor: pointer;
    display: flex;
    justify-content: flex-start;
    align-items: flex-start;
    position: relative;
    font-weight: normal;
    font-size: @14px;
    color: rgba(255, 255, 255, 0.4);
    .anim;
    line-height: 1;
    user-select: none;

    &:hover {
      color: #fff;
    }

    &:before {
      content: '';
      width: @18px;
      height: @18px;
      border-radius: @4px;
      background: rgba(255, 255, 255, 0.2);
      display: flex;
      align-items: center;
      justify-content: center;
      margin-right: @8px;
      position: relative;
      top: -@2px;
    }
  }

  input:disabled + label {
    cursor: default;

    &:hover {
      color: rgba(255, 255, 255, 0.4);
    }
  }

  input:checked + label {
    &:before {
      background: #27AE60 url('./images/svg/tablet/checkmark.svg') no-repeat center center;
      background-size: 90% 90%;
    }
  }

  label:active:after {
    width: @34px;

  }
}


